import MenuBar from "../../components/MenuBar";
import '../../styles/main.css';
const Main = () => {
  return (
    <div className="main-container">
      <Header text={"짤방저장소"}/>
      <div className="main">
        <img src="" alt="배경화면" />
        <div>
          왜 안바뀌는데?
        </div>
      </div>
      <MenuBar/>
    </div>
  );
};

export default Main;
